import s from './App.module.css';
import { Header } from './Header/Header';


function App() {


  return (
    <div className={s.app}>
      <h1>Generate a secure password</h1>
      <div className={s.password}>
        <input placeholder='Generating....' />
      </div>
      <div className={s.settings}>
        <div>
          Password Length <input type="range" min="1" max="20" step="1" value="12" oninput="sizePic()" />
        </div>
        <div>
          <input type='checkbox' /> Uppercase
          <input type='checkbox' /> Lowercase
          <input type='checkbox' /> Numbers
          <input type='checkbox' /> Symbols
        </div>
    </div>

    </div >
  );
}

export default App;
